"""![스크린샷 2023-03-27 오후 10.25.58.png](data:image/png;base64,)

### SGD Example using a Quadratic Equation
"""

# measuring the speed of a ball thrown in the air.
# It would start fast, and then get slower as it reached the highest point
# x
time = torch.arange(0,20).float();
time

# and y
# It would start fast, and then get slower as it went up the hill; it would be slowest at the top, and it would then speed up again as it went downhill.
speed = torch.randn(20)*3 + 0.75*(time-9.5)**2 + 1 # a bit of random noise, since measuring things manually isn't precise
plt.scatter(time,speed);

speed

# We try to find the function generating the data: speed = 0.75*(time-9.5)**2 + 1
# Let's assume that we know that the function is in the form a*(time**2) + b*time + c.
# to find the best quadratic function, we only need to find the best values for a, b, and c.
def f(t, params):
    w1,w2,b = params
    return w1*(t**2) + w2*t + b

# loss function: see how our current ws do.
# A loss function return a value based on discrepancies between predictions and targets (true values)
# it indicates how bad parameters do.
def mse(preds, targets): return ((preds-targets)**2).mean().sqrt()
#Now, let's work through our 7 step process.

"""#### Step 1: Initialize the parameters"""

# initialize the parameters to random values,
# and tell PyTorch that we want to track their gradients, using requires_grad_
params = torch.randn(3).requires_grad_()
params

params.grad

"""#### Step 2: Calculate the predictions"""

preds = f(time, params) # we calculate the predictions using the current params

preds

def show_preds(preds, ax=None):
    if ax is None: ax=plt.subplots()[1]
    ax.scatter(time, speed)
    ax.scatter(time, to_np(preds), color='red')
    ax.set_ylim(-300,100)

show_preds(preds) # This doesn't look very close

"""#### Step 3: Calculate the loss"""

# We calculate the loss using mse.
loss = mse(preds, speed)
loss

"""#### Step 4: Calculate the gradients"""

# Our goal is now to improve loss. To do that, we'll need to know the gradients.
loss.backward()
# To calculate the gradients we call backward on the loss. But this loss was itself calculated by mse, which in turn took preds as an input, which was calculated using f taking as an input params, which was the object on which we originally called required_grads_—which is the original call that now allows us to call backward on loss. This chain of function calls represents the mathematical composition of functions, which enables PyTorch to use calculus's chain rule under the hood to calculate these gradients.

params.grad

"""#### Step 5: Step the weights."""

params.data

#lr = 1e-5 # 1e-5 = 0.00001
lr = 5e-4
# lr = 0.0005
params.data -= lr * params.grad.data # we need to update the parameters based on the gradients we just calculated:
# params.data = params.data - lr * params.grad.data
params.grad = None

params.data

preds = f(time,params) # Is the loss improved?
mse(preds, speed)

show_preds(preds)

# def f(t, params):
#    a,b,c = params
#    return a*(t**2) + (b*t) + c
# def mse(preds, targets): return ((preds-targets)**2).mean().sqrt()

# We need to repeat this a few times, so we'll create a function to apply one step
def apply_step(params, prn=True):
    preds = f(time, params)
    loss = mse(preds, speed)
    loss.backward() # gradients are calculated
    params.data -= lr * params.grad.data
    params.grad = None
    if prn: print(loss.item())
    return preds

"""#### Step 6: Repeat the process"""

for i in range(16): apply_step(params) #Now we iterate. By looping and performing many improvements, we hope to reach a good result

_,axs = plt.subplots(1,4,figsize=(12,3)) # visualizing the prediction and actual values (and thus loss)
axs
for ax in axs: show_preds(apply_step(params, False), ax)
plt.tight_layout()

"""#### Step 7: stop"""